import React from 'react';

function VideoStream({ userId, joinTime }) {
  // Display placeholder for video until real media stream is integrated
  return (
    <div className="video-box">
      <div className="video-placeholder">
        <p>{userId}</p>
        <p>Joined at: {joinTime}</p>
      </div>
    </div>
  );
}

export default VideoStream;
